import styled from "styled-components";
import { Link } from "react-router-dom";
import logo from "./HOME/LogoPIprueba.png";

export default function Nav() {
  return (
    <NavBarStyle>
      <img src={logo} alt="" />
      <section>
      <Link to="/" className="linknav">Home</Link>
      <Link to="/countries" className="linknav">Ver paises</Link>
      <Link to="/activities" className="linknav">Actividades</Link>
      <Link to="/contact" className="linknav">Contacto</Link></section>
    </NavBarStyle>
  )
}

const NavBarStyle = styled.div`
    display: grid;
    grid-template-columns: 15rem 5fr;
  padding: 1rem 0;
  /* max-width: 120rem; */
  margin: 0 auto;
  /* transition: all .8s; */
  position: relative;
  font-weight: bold;
  img{
    height:6rem;
  }

  
`;
